(1146, 'elementor_remote_info_feed_data', 'a:3:{i:0;a:5:{s:5:\"title\";s:97:\"Introducing Elementor 3.19: Display Conditions, Role Permissions in the Element Manager, and More\";s:7:\"excerpt\";s:230:\"Create dynamic visitor experiences, customize your teammates’ widget panels, protect forms from spam submissions, generate variations in the template library, and use URLs from the open web as a reference to generate containers.\";s:7:\"created\";i:1707315304;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:152:\"https://elementor.com/blog/elementor-319-display-conditions-akismet-integration/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:75:\"Redefining the Web Creation Experience: Elementor Unveils AI for Containers\";s:7:\"excerpt\";s:296:\"Elementor has always been a pioneer in the WordPress ecosystem, and now, we\'re taking a monumental leap into the future with the release of our advanced AI editor capability for containers. We are thrilled to introduce a groundbreaking AI capability that will reshape the way you create websites.\";s:7:\"created\";i:1702548879;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:160:\"https://elementor.com/blog/new-web-creation-experience-with-elementor-ai-for-containers/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:21:\"New in Elementor 3.18\";s:7:\"excerpt\";s:77:\"Element Manager, Taxonomy Filters with Multi-Selection Capabilities, and More\";s:7:\"created\";i:1702304459;s:5:\"badge\";s:3:\"NEW\";s:3:\"url\";s:161:\"https://elementor.com/blog/elementor-318-element-manager-multi-selection-taxonomy-filter/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
